import DeckList from "./DeckList";
import React from "react"
import {Button} from "../Forms/Button"


export default function Home ({decks}) {
    const history = useHistory()

    if(decks) {
        return (
            <div>
                <Link to="/decks/new">
        <Button>+ Create Deck</Button>
      </Link>
            <hr />
                <DeckList decks={decks} />
            </div>
        )
    }
    return <p>Loading...</p>
}
